import React from 'react';
import { HiOutlineMenuAlt1 } from "react-icons/hi";

const toolbar = props => (
    <>
            <a href="#" className="push-menu-btn">
                <HiOutlineMenuAlt1 />
            </a>

            <div className="toolbar_navigation-items">
                <ul>
                    <li><a href="/">Home</a></li>
                    <li><a href="/">About Us</a></li>
                </ul>
            </div>
    </>
);

export default toolbar;
